 * Styles for the root slot
 */ const useRootStyles = makeStyles({
    root: {
        position: 'relative',
        display: 'inline-grid',
        touchAction: 'none',
        alignItems: 'center',
        justifyItems: 'center'
    },
    small: {
        [thumbSizeVar]: '16px',
        [railSizeVar]: '2px',
        minHeight: '24px'
    },
    medium: {
        [thumbSizeVar]: '20px',
        [railSizeVar]: '4px',
        minHeight: '32px'
