        gridColumnStart: '1',
        gridColumnEnd: '-1',
        ...shorthands.padding(0),
        ...shorthands.margin(0)
    },
    disabled: {
        cursor: 'default'
    },
    horizontal: {
        height: `var(${thumbSizeVar})`,
        width: '100%'
    },
    vertical: {
        height: '100%',
        width: `var(${thumbSizeVar})`,
        '-webkit-appearance': 'slider-vertical'
    }
